import React from 'react';
import styled from 'styled-components';
import Row from 'react-bootstrap/Row'
import Container from 'react-bootstrap/Container'
import {CustomJumbotron} from './components/CustomJumbotron';
import {Footer} from './components/Footer';
import {CustomCard} from './components/CustomCard';
import BackgroundImage from './assets/background.png';


const Styles = styled.div`
    .row {
        margin-left: 0px;
        margin-right: 0px;
        font-family: 'Montserrat', sans-serif;
    }

    .col {
        text-align: center;
    }
`;


export const Posts = () => {
    return (
        <Styles>
            <CustomJumbotron>Posts</CustomJumbotron>
            <div style = {{ backgroundColor: '#cfcfcf'}}>
                <Container style = {{paddingTop: 30, paddingBottom: 70}} >
                    <Row>
                        <CustomCard subTitle = 'October 12, 2019'
                                    title = 'New Proof of the Quadratic Formula'
                                    image = {BackgroundImage}
                                    link = "/quadratic">
                        </CustomCard>
                        <CustomCard subTitle = 'October 10, 2019'
                                    title = 'What I Learned About Life From Buying a Goat on Craigslist'
                                    image = {BackgroundImage}
                                    link = "/goat">
                        </CustomCard>
                    </Row>
                </Container>
            </div>
            <Footer></Footer>
        </Styles>
    );
}
